import { useDrop } from "react-dnd";

function Alliance({ alliance: alliance }) {
  const [{ isOver }, drop] = useDrop(() => ({
    accept: "employee",
    drop: (item) => {
      addEmployeeToTeam(item.employee, props.team);
    },
  }));
  return <div className="alliance">{alliance.Name}</div>;
}
export default Alliance;
